import React from "react";
import Navbar from './Navbar';
import { About } from '../components/about/about';

export default function SelectPage(whichPage) {
    switch(whichPage) {
        case 'Dashboard': 
            return (
            <Navbar />
            )
        case 'About': 
            return (
                <About />
            )
        default:
            return (
                <Navbar/>
            )
    }
}
